import React, { Component } from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";

class Chart extends React.Component {
  render() {
    const { response } = this.props;
    const array = [];
    if (response != null) {
      response.nedbetalingsplan.innbetalinger.map((row, index) => {
        array.push({
          dato: row.dato,
          innbetaling: Math.round(row.innbetaling),
          renter: Math.round(row.renter),
        });
        return array;
      });
    }
    return (
      <BarChart
        width={700}
        height={500}
        data={array}
        margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
      >
        <XAxis dataKey="dato" />
        <YAxis />
        <CartesianGrid strokeDasharray="3 3" />
        <Tooltip />
        <Legend />
        <Bar dataKey="innbetaling" stackId="a" fill="#8884d8" />
        <Bar dataKey="renter" stackId="a" fill="#82ca9d" />
      </BarChart>
    );
  }
}

export default Chart;
